function ToolTip({ x, y, width, text }: { x: number; y: number; width: number; text: string }) {
  return (
    <g className="group">
      <ToolTipCircle cx={x} cy={y} />
      <rect x={x + 17} y={y - 12} width={width} height="24" rx="4" fill="black" />
      <rect
        x={x + 15}
        y={y - 14}
        width={width + 4}
        height="28"
        rx="6"
        stroke="black"
        strokeOpacity="0.2"
        strokeWidth="4"
      />
      <text
        x={x + 23}
        y={y + 4}
        className="fill-slate-200 italic"
        style={{
          fontFamily: `ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, "Liberation Mono", "Courier New", monospace`,
          fontSize: '12px',
        }}
      >
        {text}
      </text>
    </g>
  );
}

function ToolTipCircle({ cx, cy }: { cx: number; cy: number }) {
  return (
    <g>
      <style
        dangerouslySetInnerHTML={{
          __html: `
          .svg-animate-ping {
            animation: svg-ping cubic-bezier(0,0,.2,1) 2s infinite;
          }
          @keyframes svg-ping {
            0% { stroke-width: 0px; opacity: 1; }
            75%, 100% { stroke-width: 12px; opacity: 0; }
          }
          `,
        }}
      />
      <circle
        className="fill-indigo-300 stroke-indigo-200 stroke-0 transition-all group-hover:fill-indigo-200 group-hover:stroke-2"
        cx={cx}
        cy={cy}
        r="5"
        fill="#A5B4FC"
      />
      <circle
        className="svg-animate-ping stroke-[0px] transition-all group-hover:stroke-[8px]"
        cx={cx}
        cy={cy}
        r="5"
        stroke="#A5B4FC"
      />
    </g>
  );
}
